const results = [];

for (const item of items) {
  const ad_id = item.json.ad_id || "";
  const account_id = item.json.account_id || "";
  const ad_text = item.json.ad_text || "";
  const image_url = item.json.image?.[0]?.url || "";
  const video_url = item.json.video?.[0]?.url || "";

  results.push({
    json: {
      ad_id,
      account_id,
      ad_text,
      image_url,
      video_url
    }
  });
}

return results;

