return items.map(item => {
    // Function to extract file ID and convert to direct link
    function convertDriveLink(url) {
        const match = url.match(/\/d\/(.*?)\//);
        return match ? `https://drive.google.com/uc?export=download&id=${match[1]}` : null;
    }

    // Convert image and video URLs into Airtable-compatible format
    const imageUrl = convertDriveLink(item.json.image_url);
    const videoUrl = convertDriveLink(item.json.video_url);

    return {
        json: {
            ad_id: item.json.ad_id,
            ad_body: item.json.ad_body,
            image: imageUrl ? [{ "url": imageUrl }] : [],
            video: videoUrl ? [{ "url": videoUrl }] : []
        }
    };
});

const items = $input.all();
const formattedData = items.map((item) => {
  try {
    const cleanContent = item?.json?.message?.content.replace(/```json\n|```/g, '');
    const content = JSON.parse(cleanContent);
    return content[0];
  } catch (error) {
    return { error: `Invalid JSON: ${item?.json?.message?.content}`, detail: error.message };
  }
});
return formattedData;

const items = $input.all();
